public class TaskEvenNums {

	public static void main(String[] args) {
		// TODO Auto-generated method stub


		
		
		
		/// print only even numbers from 10 to 100
	
		int num=10;
	while(num<=100) {
		if (num%2==0) {
			System.out.println(num);
		}
	num++;
	
	}
	
	
	
	
	
	
	}

}
